import React, { useEffect } from "react";
import { gsap } from "gsap";

const AnimatedSVG = () => {
    useEffect(() => {
        gsap.to("#leaf", { rotation: 360, duration: 2, repeat: -1 });
    }, []);

    return (
        <svg width="100" height="100" viewBox="0 0 100 100">
            <circle
                cx="50"
                cy="50"
                r="40"
                stroke="green"
                strokeWidth="4"
                fill="yellow"
            />
            <rect id="leaf" x="45" y="20" width="10" height="40" fill="green" />
        </svg>
    );
};

export default AnimatedSVG;
